import React ,{useState} from "react";
import {Button,Collapse,Breadcrumb,BreadcrumbItem} from 'reactstrap'

const DaySlot = ({day}) => {
    const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
    <div>
      <Button
        block
        color="success"
        onClick={toggle}
        style={{ marginBottom: "1rem", marginTop: "1rem" }}
      >
          {day}
      </Button>
      <Collapse isOpen={isOpen}>
      <Breadcrumb>
        <BreadcrumbItem active><Button>Book</Button></BreadcrumbItem>
      </Breadcrumb>
      </Collapse>
    </div>
  );
};

export default DaySlot;
